import React from "react";
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper/modules';

const Home = () => {
    return (
        <div className="home bg-color-2 ">
            <div className="container">
                <div className="row">
                    <div className="col-md-9">
                        <Swiper
                            modules={[Navigation, Pagination, Scrollbar, A11y]}
                            spaceBetween={0}
                            slidesPerView={1}
                            navigation
                        >
                            <SwiperSlide>
                                <img src="https://cdn3009.cdn-template-4s.com/media/banner/slide-2.webp"/>
                            </SwiperSlide>
                            <SwiperSlide>
                                <img src="https://cdn3009.cdn-template-4s.com/media/banner/slide-1.webp"/>
                            </SwiperSlide>
                        </Swiper>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home
